import React from 'react';
import './App.css';
import Books from './Components/Bookinfos'
import BookForm from './Components/CreateBook'
import Table_test from './Components/Test'

import { Grommet, Heading,Footer ,Text,Box,grommet,Grid} from 'grommet'

class App extends React.Component {
  render() {
    return (
      <Grommet theme={grommet} full>
      <Grid fill rows={["auto", "flex", "auto"]}>
      <Box tag="header" background="#00739D" pad="medium" color="#00739D">
      <Heading margin="none" color="#81FCED">My BookInfo</Heading>
      </Box>
        <Table_test/>
       <Box margin="xsmall" pad="small"><BookForm/></Box>
        <Box flex={false} tag="footer" background="#00739D" pad="medium">
      <Heading margin="none" size="small">Nahokov</Heading>
      </Box>
      </Grid>
    </Grommet>
    );
  }

}


